CREATE DATABASE IF NOT EXISTS tellu3;

USE tellu3;

GRANT ALL ON tellu3.* TO 'tellu'@'localhost' IDENTIFIED BY 'tellu';
GRANT ALL ON tellu3.* TO 'tellu'@'%' IDENTIFIED BY 'tellu';

FLUSH PRIVILEGES;

CREATE TABLE tellu3.agent (
	node_id		BIGINT UNSIGNED NOT NULL,
	name		VARCHAR(64),

	INDEX		(node_id)
);

CREATE TABLE tellu3.agentbusiness (
	node_id		BIGINT UNSIGNED NOT NULL,
	business	VARCHAR(64),

	INDEX		(node_id)
);

CREATE TABLE tellu3.agentversion (
	node_id		BIGINT UNSIGNED NOT NULL,
	version		VARCHAR(64),

	INDEX		(node_id)
);

CREATE TABLE tellu3.cpu (
	node_id		BIGINT UNSIGNED NOT NULL,
	cpus		BIGINT UNSIGNED DEFAULT 0,
	cores		BIGINT UNSIGNED DEFAULT 0,
	siblings	BIGINT UNSIGNED DEFAULT 0,
	mhz		BIGINT UNSIGNED DEFAULT 0,
	cache		BIGINT UNSIGNED DEFAULT 0,
	mips		BIGINT UNSIGNED DEFAULT 0,

	INDEX		(node_id)
);

CREATE TABLE tellu3.daemon (
	node_id		BIGINT UNSIGNED NOT NULL,
	cmdline		VARCHAR(255),
	name		VARCHAR(64),
	state		VARCHAR(2),
	pid		INT UNSIGNED,
	ppid		INT UNSIGNED,
	threads		INT UNSIGNED,
	vmdata		BIGINT UNSIGNED,
	vmexe		BIGINT UNSIGNED,
	vmhwm		BIGINT UNSIGNED,
	vmlib		BIGINT UNSIGNED,
	vmpeak		BIGINT UNSIGNED,
	vmpte		BIGINT UNSIGNED,
	vmrss		BIGINT UNSIGNED,
	vmsize		BIGINT UNSIGNED,
	vmstk		BIGINT UNSIGNED,
	rchar		BIGINT UNSIGNED,
	wchar		BIGINT UNSIGNED,
	syscr		BIGINT UNSIGNED,
	syscw		BIGINT UNSIGNED,
	rbyte		BIGINT UNSIGNED,
	wbyte		BIGINT UNSIGNED,
	uid		VARCHAR(64),
	gid		VARCHAR(64),

	INDEX		(node_id)
);

CREATE TABLE tellu3.dev (
	node_id		BIGINT UNSIGNED NOT NULL,
	category	VARCHAR(64),
	product		VARCHAR(255),
	subsystem	VARCHAR(64),
	capabilities	TEXT NOT NULL,
	vendor		VARCHAR(255),
	opt		TEXT NOT NULL,

	INDEX		(node_id)
);

CREATE TABLE tellu3.disk (
	node_id		BIGINT UNSIGNED NOT NULL,
	dev		VARCHAR(64),
	path		VARCHAR(255),
	fs		VARCHAR(64),
	opts		TEXT NOT NULL,
	size		BIGINT UNSIGNED DEFAULT 0,
	avail		BIGINT UNSIGNED DEFAULT 0,
	serial		VARCHAR(64),

	INDEX		(node_id)
);

CREATE TABLE tellu3.mem (
	node_id		BIGINT UNSIGNED NOT NULL,
	totalram	BIGINT UNSIGNED DEFAULT 0,
	availram	BIGINT UNSIGNED DEFAULT 0,
	totalswap	BIGINT UNSIGNED DEFAULT 0,
	availswap	BIGINT UNSIGNED DEFAULT 0,
	buffers		BIGINT UNSIGNED DEFAULT 0,
	cached		BIGINT UNSIGNED DEFAULT 0,

	INDEX		(node_id)
);

CREATE TABLE tellu3.nic (
	node_id		BIGINT UNSIGNED NOT NULL,
	name		VARCHAR(64),
	ip4		VARCHAR(16),
	ip6		VARCHAR(46),
	broadcast4	VARCHAR(16),
	broadcast6	VARCHAR(46),
	netmask4	VARCHAR(16),
	netmask6	VARCHAR(46),
	mac		varchar(48),

	INDEX		(node_id)
);

CREATE TABLE tellu3.node (
	node_id		BIGINT UNSIGNED NOT NULL,
	node		VARCHAR(64),
	domain		VARCHAR(64),
	sys		VARCHAR(64),
	rel		VARCHAR(64),
	dist		VARCHAR(255),
	arch		VARCHAR(16),
	model		VARCHAR(64),
	sernum		VARCHAR(255),
	secnum		VARCHAR(255),
	location	VARCHAR(255),
	iis		BOOL DEFAULT FALSE,
	esd		BIGINT UNSIGNED NOT NULL,
	dosd		VARCHAR(8),
	mosd		VARCHAR(255),
	totrepairs	BIGINT UNSIGNED NOT NULL,
	lastrepair	VARCHAR(8),
	acquired	VARCHAR(8),
	warranty	BIGINT UNSIGNED NOT NULL,
	addinfo		TEXT NOT NULL,
	disposed	TINYINT DEFAULT 0,
	descr		TEXT NOT NULL,
	note		LONGTEXT NOT NULL,

	PRIMARY KEY	(node_id),
	INDEX		(node_id),
	INDEX		(node),
	INDEX		(domain),
	INDEX		(sys)
);

CREATE TABLE tellu3.port (
	node_id		BIGINT UNSIGNED NOT NULL,
	tcp		TEXT NOT NULL,
	udp		TEXT NOT NULL,

	INDEX		(node_id)
);

CREATE TABLE tellu3.proc (
	node_id		BIGINT UNSIGNED NOT NULL,
	cmdline		VARCHAR(255),
	name		VARCHAR(64),
	state		VARCHAR(2),
	pid		INT UNSIGNED,
	ppid		INT UNSIGNED,
	threads		INT UNSIGNED,
	vmdata		BIGINT UNSIGNED,
	vmexe		BIGINT UNSIGNED,
	vmhwm		BIGINT UNSIGNED,
	vmlib		BIGINT UNSIGNED,
	vmpeak		BIGINT UNSIGNED,
	vmpte		BIGINT UNSIGNED,
	vmrss		BIGINT UNSIGNED,
	vmsize		BIGINT UNSIGNED,
	vmstk		BIGINT UNSIGNED,
	rchar		BIGINT UNSIGNED,
	wchar		BIGINT UNSIGNED,
	syscr		BIGINT UNSIGNED,
	syscw		BIGINT UNSIGNED,
	rbyte		BIGINT UNSIGNED,
	wbyte		BIGINT UNSIGNED,
	uid		VARCHAR(64),
	gid		VARCHAR(64),

	INDEX		(node_id)
);

CREATE TABLE tellu3.run (
	node_id		BIGINT UNSIGNED NOT NULL,
	procs		INT UNSIGNED,
	threads		INT UNSIGNED,

	INDEX		(node_id)
);

CREATE TABLE tellu3.software (
	node_id		BIGINT UNSIGNED NOT NULL,
	type		INT UNSIGNED,
	name		VARCHAR(255),
	version		VARCHAR(64),
	size		BIGINT UNSIGNED,
	url		VARCHAR(255),

	INDEX		(node_id)
);

CREATE TABLE tellu3.system (
	node_id		BIGINT UNSIGNED NOT NULL,
	bbmanufacturer	VARCHAR(255),
	bbproduct	VARCHAR(255),
	bbversion	VARCHAR(255),
	sysfamily	VARCHAR(255),
	sysmanufacturer	VARCHAR(255),
	sysproduct	VARCHAR(255),
	sysversion	VARCHAR(255),

	INDEX		(node_id)
);

CREATE TABLE tellu3.user (
	node_id		BIGINT UNSIGNED NOT NULL,
	uid		VARCHAR(64),
	grp		VARCHAR(64),
	gecos		VARCHAR(64),
	homedir		VARCHAR(255),

	INDEX		(node_id)
);

CREATE TABLE tellu3.util (
	node_id		BIGINT UNSIGNED NOT NULL,
	load1		INT UNSIGNED,
	load2		INT UNSIGNED,
	load3		INT UNSIGNED,
	uptime1		BIGINT UNSIGNED,
	uptime2		BIGINT UNSIGNED,

	INDEX		(node_id)
);

CREATE TABLE tellu3.log (
	time		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	level		INT UNSIGNED,
	node		VARCHAR(64),
	domain		VARCHAR(64),
	sys		VARCHAR(64),
	rel		VARCHAR(64),
	uid		VARCHAR(64),
	grp		VARCHAR(64),
	proc		VARCHAR(64),
	procver		VARCHAR(64),
	note		TEXT NOT NULL,

	INDEX		(time),
	INDEX		(level),
	INDEX		(node),
	INDEX		(proc, procver)
);

CREATE TABLE tellu3.history (
	time		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	node		VARCHAR(64),
	domain		VARCHAR(64),
	sys		VARCHAR(64),
	rel		VARCHAR(64),
	uid		VARCHAR(64),
	grp		VARCHAR(64),
	proc		VARCHAR(64),
	procver		VARCHAR(64),
	conns		BIGINT UNSIGNED DEFAULT 0,

	INDEX		(time),
	INDEX		(node),
	INDEX		(proc, procver)
);

CREATE TABLE tellu3.machine (
	node_id		BIGINT UNSIGNED NOT NULL,				# machine id
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# machine creation time
	creator		VARCHAR(64),						# machine created by
	modified	TIMESTAMP,						# machine modification time
	modifier	VARCHAR(64),						# machine modified by

	PRIMARY KEY	(node_id),
	INDEX		n_id (node_id), FOREIGN KEY (node_id) REFERENCES node(node_id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_devices (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# device id
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# device creation time
	creator		VARCHAR(64),						# device created by
	modified	TIMESTAMP,						# device modification time
	modifier	VARCHAR(64),						# device modified by
	disposed	TINYINT DEFAULT 0,					# device is disposed
	model		VARCHAR(64),						# device model
	category	VARCHAR(64),						# device category
	manufacturer	VARCHAR(64),						# device manufacturer
	size		VARCHAR(255),						# device size
	memory		BIGINT UNSIGNED NOT NULL,				# device memory
	connection	BIGINT UNSIGNED NOT NULL,				# device connection type
	netsupport	BOOL DEFAULT FALSE,					# device supports network
	ipaddress	VARCHAR(46),						# device ip address
	sernum		VARCHAR(255),						# device serial number
	secnum		VARCHAR(255),						# device security number
	location	VARCHAR(255),						# device location
	iis		BOOL DEFAULT FALSE,					# device is in service
	esd		BIGINT UNSIGNED NOT NULL,				# device estimated service duration
	dosd		TIMESTAMP,						# device date of service delivery
	mosd		VARCHAR(255),						# device method of service delivery
	totrepairs	BIGINT UNSIGNED NOT NULL,				# device total repair counter
	lastrepair	TIMESTAMP,						# device last repaired
	acquired	TIMESTAMP,						# device acquired
	warranty	BIGINT UNSIGNED NOT NULL,				# device warranty
	addinfo		TEXT NOT NULL,						# device additional info
	descr		TEXT NOT NULL,						# device description
	note		LONGTEXT NOT NULL,					# notes of this device

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(model),
	INDEX		(category),
	INDEX		(manufacturer)
);

CREATE TABLE tellu3.skin_devices_map (
	device_id	BIGINT UNSIGNED NOT NULL,				# id to skin_devices table
	machine_id	BIGINT UNSIGNED NOT NULL,				# id to machines table
	devices_id	BIGINT UNSIGNED NOT NULL,				# id to skin_devices table
	peripherals_id	BIGINT UNSIGNED NOT NULL,				# id to skin_peripherals table

	INDEX		a_id (device_id), FOREIGN KEY (device_id) REFERENCES skin_devices(id) ON DELETE CASCADE,
	INDEX		m_id (machine_id), FOREIGN KEY (machine_id) REFERENCES machine(node_id) ON DELETE CASCADE,
	INDEX		d_id (devices_id), FOREIGN KEY (devices_id) REFERENCES skin_devices(id) ON DELETE CASCADE,
	INDEX		p_id (peripherals_id), FOREIGN KEY (peripherals_id) REFERENCES skin_peripherals(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_files (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# file id
	owner		VARCHAR(64),						# file owner
	name		VARCHAR(64),						# file name
	rand		VARCHAR(64),						# file random name
	file		VARCHAR(255),						# file real name
	size		BIGINT DEFAULT 0,					# file size
	public		BOOL DEFAULT TRUE,					# file is public or not
	descr		TEXT NOT NULL,						# file description
	note		LONGTEXT NOT NULL,					# notes of this file

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(name)
);

CREATE TABLE tellu3.skin_files_map (
	file_id		BIGINT UNSIGNED NOT NULL,				# id to skin_files table
	node_id		BIGINT UNSIGNED NOT NULL,				# id to machine table
	devices_id	BIGINT UNSIGNED NOT NULL,				# id to skin_devices table
	peripherals_id	BIGINT UNSIGNED NOT NULL,				# id to skin_peripherals table

	INDEX		f_id (file_id), FOREIGN KEY (file_id) REFERENCES skin_files(id) ON DELETE CASCADE,
	INDEX		n_id (node_id), FOREIGN KEY (node_id) REFERENCES machine(node_id) ON DELETE CASCADE,
	INDEX		d_id (devices_id), FOREIGN KEY (devices_id) REFERENCES skin_devices(id) ON DELETE CASCADE,
	INDEX		p_id (peripherals_id), FOREIGN KEY (peripherals_id) REFERENCES skin_peripherals(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_groups (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# group id
	name		VARCHAR(64),						# group name
	descr		TEXT NOT NULL,						# group description
	note		LONGTEXT NOT NULL,					# notes of this group

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(name)
);


CREATE TABLE tellu3.skin_groups_map (
	user_id		BIGINT UNSIGNED NOT NULL,				# id to skin_users table
	group_id	BIGINT UNSIGNED NOT NULL,				# id to skin_groups table

	INDEX		u_id (user_id), FOREIGN KEY (user_id) REFERENCES skin_users(id) ON DELETE CASCADE,
	INDEX		g_id (group_id), FOREIGN KEY (group_id) REFERENCES skin_groups(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_help (
	name		VARCHAR(64),						# page name
	title		VARCHAR(255),						# page title
	help		LONGTEXT NOT NULL,					# page help text
	descr		TEXT NOT NULL,						# page description
	note		LONGTEXT NOT NULL,					# notes of this page

	INDEX		(name)
);

