CREATE TABLE tellu3.skin_misc (
	class		VARCHAR(64),						# item class
	value		VARCHAR(64),						# item value
	place		BIGINT UNSIGNED NOT NULL,				# item place in class
	title		VARCHAR(255),						# item title

	INDEX		(class, value)
);


CREATE TABLE tellu3.skin_passwords (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# password id
	owner		VARCHAR(64),						# password owner
	name		VARCHAR(64),						# password name
	service		VARCHAR(255),						# password service
	username	VARCHAR(255),						# password username
	password	VARCHAR(255),						# password itself
	public		BOOL DEFAULT FALSE,					# password is public or not
	descr		TEXT NOT NULL,						# password description
	note		LONGTEXT NOT NULL,					# notes of this password

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(name)
);

CREATE TABLE tellu3.skin_passwords_map (
	pwd_id		BIGINT UNSIGNED NOT NULL,				# id to skin_passwords table
	node_id		BIGINT UNSIGNED NOT NULL,				# id to machine table
	devices_id	BIGINT UNSIGNED NOT NULL,				# id to skin_devices table
	peripherals_id	BIGINT UNSIGNED NOT NULL,				# id to skin_peripherals table

	INDEX		w_id (pwd_id), FOREIGN KEY (pwd_id) REFERENCES skin_passwords(id) ON DELETE CASCADE,
	INDEX		n_id (node_id), FOREIGN KEY (node_id) REFERENCES machine(node_id) ON DELETE CASCADE,
	INDEX		d_id (devices_id), FOREIGN KEY (devices_id) REFERENCES skin_devices(id) ON DELETE CASCADE,
	INDEX		p_id (peripherals_id), FOREIGN KEY (peripherals_id) REFERENCES skin_peripherals(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_peripherals (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# peripheral id
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# peripheral creation time
	creator		VARCHAR(64),						# peripheral created by
	modified	TIMESTAMP,						# peripheral modification time
	modifier	VARCHAR(64),						# peripheral modified by
	disposed	TINYINT DEFAULT 0,					# peripheral is disposed
	model		VARCHAR(64),						# peripheral model
	category	VARCHAR(64),						# peripheral category
	manufacturer	VARCHAR(64),						# peripheral manufacturer
	size		VARCHAR(255),						# peripheral size
	memory		BIGINT UNSIGNED NOT NULL,				# peripheral memory
	connection	BIGINT UNSIGNED NOT NULL,				# peripheral connection type
	netsupport	BOOL DEFAULT FALSE,					# peripheral supports network
	ipaddress	VARCHAR(46),						# peripheral ip address
	sernum		VARCHAR(255),						# peripheral serial number
	secnum		VARCHAR(255),						# peripheral security number
	location	VARCHAR(255),						# peripheral location
	iis		BOOL DEFAULT FALSE,					# peripheral is in service
	esd		BIGINT UNSIGNED NOT NULL,				# peripheral estimated service duration
	dosd		TIMESTAMP,						# peripheral date of service delivery
	mosd		VARCHAR(255),						# peripheral method of service delivery
	totrepairs	BIGINT UNSIGNED NOT NULL,				# peripheral total repair counter
	lastrepair	TIMESTAMP,						# peripheral last repaired
	acquired	TIMESTAMP,						# peripheral acquired
	warranty	BIGINT UNSIGNED NOT NULL,				# peripheral warranty
	addinfo		TEXT NOT NULL,						# peripheral additional info
	descr		TEXT NOT NULL,						# peripheral description
	note		LONGTEXT NOT NULL,					# notes of this peripheral

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(model),
	INDEX		(category),
	INDEX		(manufacturer)
);

CREATE TABLE tellu3.skin_peripherals_map (
	peripheral_id	BIGINT UNSIGNED NOT NULL,				# id to skin_peripherals table
	machine_id	BIGINT UNSIGNED NOT NULL,				# id to machine table
	devices_id	BIGINT UNSIGNED NOT NULL,				# id to devices table
	peripherals_id	BIGINT UNSIGNED NOT NULL,				# id to peripherals table

	INDEX		a_id (peripheral_id), FOREIGN KEY (peripheral_id) REFERENCES skin_peripherals(id) ON DELETE CASCADE,
	INDEX		m_id (machine_id), FOREIGN KEY (machine_id) REFERENCES machine(node_id) ON DELETE CASCADE,
	INDEX		d_id (devices_id), FOREIGN KEY (devices_id) REFERENCES skin_devices(id) ON DELETE CASCADE,
	INDEX		p_id (peripherals_id), FOREIGN KEY (peripherals_id) REFERENCES skin_peripherals(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_perm (
	perm		BIGINT UNSIGNED NOT NULL,				# permission bit
	name		VARCHAR(64),						# permission name
	descr		TEXT NOT NULL,						# permission description
	note		LONGTEXT NOT NULL,					# notes of this permission

	INDEX		(name)
);


CREATE TABLE tellu3.skin_perm_nodes (
	user_id		BIGINT UNSIGNED NOT NULL,				# user id
	node		VARCHAR(64),						# node name
	domain		VARCHAR(64),						# domain name
	grp		VARCHAR(64),						# group name
	perm		BIGINT UNSIGNED NOT NULL,				# permission bits

	INDEX		(user_id),
	INDEX		(node),
	INDEX		(domain),
	INDEX		(grp)
);

CREATE TABLE tellu3.skin_port_tcp (
	port		INT UNSIGNED DEFAULT 0,					# tcp port number
	name		VARCHAR(64),						# tcp port name
	descr		TEXT NOT NULL,						# tcp port description

	INDEX		(port)
);


CREATE TABLE tellu3.skin_port_udp (
	port		INT UNSIGNED DEFAULT 0,					# udp port number
	name		VARCHAR(64),						# udp port name
	descr		TEXT NOT NULL,						# udp port description

	INDEX		(port)
);


CREATE TABLE tellu3.skin_rgb (
	red		INT UNSIGNED DEFAULT 0,					# red component
	green		INT UNSIGNED DEFAULT 0,					# green component
	blue		INT UNSIGNED DEFAULT 0,					# blue component
	name		VARCHAR(64),						# rgb color name

	INDEX		(name)
);


CREATE TABLE tellu3.skin_services (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# service id
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# service creation time
	creator		VARCHAR(64),						# service created by
	modified	TIMESTAMP,						# service modification time
	modifier	VARCHAR(64),						# service modified by
	disposed	TINYINT DEFAULT 0,					# service is disposed
	name		VARCHAR(64),						# service name
	descr		TEXT NOT NULL,						# service description
	note		LONGTEXT NOT NULL,					# notes of this service

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(name)
);


CREATE TABLE tellu3.skin_services_data (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# service id
	type_id		BIGINT UNSIGNED DEFAULT 0,				# service type
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# service creation time
	creator		VARCHAR(64),						# service created by
	modified	TIMESTAMP,						# service modification time
	modifier	VARCHAR(64),						# service modified by
	disposed	TINYINT DEFAULT 0,					# service is disposed
	name		VARCHAR(64),						# service name
	street		TEXT NOT NULL,						# service street address
	zip		TEXT NOT NULL,						# service zip code
	city		TEXT NOT NULL,						# service city
	country		TEXT NOT NULL,						# service country
	telephone1	TEXT NOT NULL,						# service telephone
	telephone2	TEXT NOT NULL,						# service alternate telephone
	fax1		TEXT NOT NULL,						# service fax
	fax2		TEXT NOT NULL,						# service alternate fax
	cont_person	TEXT NOT NULL,						# service contact person
	cont_telephone1	TEXT NOT NULL,						# service contact telephone
	cont_telephone2	TEXT NOT NULL,						# service contact alternate telephone
	cont_fax1	TEXT NOT NULL,						# service contact fax
	cont_fax2	TEXT NOT NULL,						# service contact alternate fax
	cont_email1	TEXT NOT NULL,						# service contact email
	cont_email2	TEXT NOT NULL,						# service contact alternate email
	brands		TEXT NOT NULL,						# service brands
	addinfo		TEXT NOT NULL,						# service additional info
	descr		TEXT NOT NULL,						# service description
	note		LONGTEXT NOT NULL,					# notes of this service

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(name),
	INDEX		t_id (type_id), FOREIGN KEY (type_id) REFERENCES skin_services(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_services_map (
	service_id	BIGINT UNSIGNED NOT NULL,				# id to skin_service_data table
	machine_id	BIGINT UNSIGNED NOT NULL,				# id to machine table
	device_id	BIGINT UNSIGNED NOT NULL,				# id to skin_devices table
	peripheral_id	BIGINT UNSIGNED NOT NULL,				# id to skin_peripherals table

	INDEX		s_id (service_id), FOREIGN KEY (service_id) REFERENCES skin_services_data(id) ON DELETE CASCADE,
	INDEX		m_id (machine_id), FOREIGN KEY (machine_id) REFERENCES machine(node_id) ON DELETE CASCADE,
	INDEX		d_id (device_id), FOREIGN KEY (device_id) REFERENCES skin_devices(id) ON DELETE CASCADE,
	INDEX		a_id (peripheral_id), FOREIGN KEY (peripheral_id) REFERENCES skin_peripherals(id) ON DELETE CASCADE
);

CREATE TABLE tellu3.skin_sessions (
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# user first access timestamp
	access		TIMESTAMP,						# user last access timestamp
	count		BIGINT UNSIGNED DEFAULT 0,				# user command count by session
	name		VARCHAR(64),						# user name
	cookie		VARCHAR(64),						# user session cookie

	INDEX		(name),
	INDEX		(cookie)
);

CREATE TABLE tellu3.skin_temp (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# temp id
	created		TIMESTAMP DEFAULT CURRENT_TIMESTAMP,			# temp creation time
	creator		VARCHAR(64),						# temp created by
	temp		LONGTEXT NOT NULL,					# temp string

	PRIMARY KEY	(id),
	INDEX		(id)
);

CREATE TABLE tellu3.skin_users (
	id		BIGINT UNSIGNED NOT NULL AUTO_INCREMENT,		# user id
	name		VARCHAR(64),						# user logon name
	gecos		VARCHAR(64),						# user real name
	homepage	VARCHAR(64) NOT NULL DEFAULT 'machine',			# user homepage
	prefs		VARCHAR(255) NOT NULL DEFAULT 'ps:800x600',		# user preferences
	password	VARCHAR(64),						# user password
	locked		BOOL DEFAULT FALSE,					# user account is locked or not
	descr		TEXT NOT NULL,						# user description
	note		LONGTEXT NOT NULL,					# notes of this user

	PRIMARY KEY	(id),
	INDEX		(id),
	INDEX		(name),
	INDEX		(password)
);


